When asked I reply "I do Sanitation work"ü§†üòâ

People don't know what we do. I like it. I don't need someone on my ass. Especially in my WAY. YOU didn't want to do it SO GET THE F*CK OUT. 

2 years and I got 18 more to go. Some us got less than that but like I said will I make it. 

This lifestyle isn't a walk in the park. When they ask us "why we chose to do this?" We reply "do you wanna do it" they say no. Well there's your answer if you don't do it THEN I WILL. Only 1% do this shit knowing it'll fuck up the mind or get us kill. 

You may know some of us or you may not but just know every single one of us has a different story. Some of us came from a poor family. Some came from a rich family. We all have one thing in common though. The WILL to fight for our families, friends and hell even ungrateful people. 

I don't know about you. I'm ready to GO. A 6-12 month deployment SHOOT let's get it. LOAD UP boys! 

